css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #575b63;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid hsl(220, 13%, 80%);
  background-color: hsl(220, 13%, 86%);
}
.github-tab-icon {
  color: #9ea2a9;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: 0.4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #c2c7d0;
  border-radius: 3px;
  padding: 0 0.25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: hsl(0, 0%, 0%);
  box-shadow: 0 1px 0 #5a8ae9;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: hsl(220, 13%, 20%);
}
